import React, { Component } from 'react';
import Train from './Train';

class ListeTrain extends Component {
    constructor(props) {
        super(props);

        this.state = {
            data: null,
        };
    }
    render() {
        return (
            <Train key={this.props.data} data={this.props.data} />
        );
    }

}

export default ListeTrain;
